import React from "react";
import './Rating.css'
import {ReactComponent as StarGrey} from '../../assets/starGrey.svg'
import {ReactComponent as StarPink} from '../../assets/starPink.svg'

export default function Rating(props){

    const starPink = <StarPink /> * Number(props.rating)
    const starGrey = <StarGrey /> * Number(5 - props.rating)

    return (
        <div className="rating">
            {starPink}
            {starGrey}
        </div>
    )
}
